import React, { Component } from "react";
import { Link } from "react-router-dom";
import Axios from "axios";

class TodosList extends Component {
  constructor(props) {
    super(props);
    this.state = { todos: [] };
  }
  componentDidMount() {
    Axios.get("http://localhost:4000/todos").then(response => {
      this.state({ todos: response.data }).catch(function(error) {
        console.log(error);
      });
    });
  }
  render() {
    return (
      <div>
        <h3>Todos List</h3>
        <table className="table table-stripped" style={{ marginTop: 20 }} />
      </div>
    );
  }
}
export default TodosList;
